import Fetch from "isomorphic-unfetch";

const Index = props => {
  return (
    <div>
      {console.log(props.bpi)}
      <p>Hello Next.js</p>
    </div>
  );
};

Index.getInitialProps = async function() {
  const res = await fetch("https://api.coindesk.com/v1/bpi/currentprice.json");
  const data = await res.json();

  return {
    bpi: data.bpi
  };
};
